var FP_LP_DONATIONS_TRUST = {
    init: function() {
        this.addVideoToSlideshow();
        this.virtualMirror();
        this.outOfStock();
        this.determinePopup();
        this.magnificationPopup();
        this.popupEvents();
        this.addVideo();
        this.attachEvents();
    },
    addVideoToSlideshow: function() {
        var poster = 'data:image/png;base64,'
        var videoIcon = 'data:image/png;base64,';
        var videoContent = '<div class="video-container" id="video-container"><video controls id="video2" preload="metadata" poster="' + poster + '"><source src="https://cdn.shopify.com/s/files/1/0797/7215/files/find_your_fit.mp4?v=1608194262" type="video/mp4"></video></div>'
        var videoModal = '<div class="fp_modal_container fp_modal_container--video"><div class="fp_modal_klaviyo-bis-close fadein"><div class="w-100" id="klaviyo-bis-modal"><div class="fp_container"><button type="button" class="fp_close klaviyo-bis-close" data-dismiss="modal">×</button>' + videoContent + '</div></div></div></div>'

        $('body').append(videoModal);
        $('#ProductThumbs').append('<div class="product-single__thumb-wrapper active-variant"><a href="#" data-image="' + poster + '" data-zoomimage="ffdd" class="product-single__thumbnail fp_thumbnail"><img src="' + videoIcon + '" alt="Casper"></a></div>')
        $('.fp_thumbnail').on('click', function() {
            setTimeout(function() { $('#ProductPhotoImg').attr('src', poster) }, 10);
        })

        var video = document.getElementById("video2");
        $('.product-single__thumb-wrapper').on('click', function() {

            if ($(this).is(":last-child")) {

                $('.popup-image img').on('click', function(e) {
                    console.log('uhm')
                    e.stopPropagation();
                    $('.fp_modal_container--video').show()
                    video.play();

                })

            } else {
                $('.popup-image img').off('click')
                video.pause();
            }

        })
    },
    virtualMirror: function() {
        $('.vm__trigger').addClass('fp_virtual-btn');
        $('.vm__trigger').text('Try Our Virtual Mirror');
    },
    outOfStock: function() {
        $('#AddToCart').css('margin-bottom', '15px')
        $('#AddToCart').after($('.klaviyo-bis-trigger').clone())
    },
    determinePopup: function() {

        $('.lens__header .klaviyo-bis-trigger').remove();
        $('.lens__header:nth-child(1)').append('<button class="fp_notsure"> Not Sure? </button>')

        var determineModal = '<div class="fp_modal_container fp_modal_container--first"><div class="fp_modal_klaviyo-bis-close fadein"><div class="w-100" id="klaviyo-bis-modal"><div class="fp_container"><button type="button" class="fp_close klaviyo-bis-close" data-dismiss="modal">×</button><h3 class="fp_modal-title">Determine your magnification</h3><a href="https://cdn.shopify.com/s/files/1/0797/7215/t/299/assets/look-diopter-chart.pdf?v=9550415733820418510" target="_blank" download class="fp_btn btn-success btn-lg col-xs-12 download-eye-chart">Download Eye Chart</a> <span class="my-3">OR</span><button type="submit" class="fp_btn btn-success btn-lg col-xs-12 determine-by-age">Determine By Age</button> </div></div></div></div>';
        $('body').append(determineModal);





    },
    magnificationPopup: function() {
        var magnificationModal = '<div class="fp_modal_container fp_modal_container--second"><div class="fp_modal_klaviyo-bis-close fadein"><div class="w-100" id="klaviyo-bis-modal"><div class="fp_container"><button type="button" class="fp_close klaviyo-bis-close" data-dismiss="modal">×</button><h3 class="fp_modal-title">magnification by age</h3> ';

        magnificationModal += '<table class="fp_magnificaation-table"> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> <tr><td>40-44</td><td> +0.75 to + 1.00 </td></tr> </table>';
        magnificationModal += '<span class="fp_back"><svg width="9" height="13" viewBox="0 0 9 13" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M8 12L0.999999 6.5L8 1" stroke="#101010"/></svg> <span>Back</span> </span> </div></div></div></div>'
        $('body').append(magnificationModal);
    },
    popupEvents: function() {
        $('.lens__header .fp_notsure').on('click', function(e) {
            e.preventDefault();
            $('.fp_modal_container--first').show();
        })

        $('.fp_close').on('click', function() {
            $('.fp_modal_container').hide();
        });

        $('.determine-by-age').on('click', function() {
            $('.fp_modal_container--first').hide();
            $('.fp_modal_container--second').show();
        })

        $('.fp_back').on('click', function() {
            $('.fp_modal_container--second').hide();
            $('.fp_modal_container--first').show();
        })


        $('.fp_modal_klaviyo-bis-close').on('click', function() {
            $('.fp_modal_container').hide();
        });

        $('.fp_container').on('click', function(e) {
            e.stopPropagation();
        });
    },
    addVideo: function() {
        var title = '<h3 class="video_title"> Flexible. Comfortable.<br>THE PERFECT FIT </h3>'
        var poster = 'data:image/png;base64,'
        var videoContent = title + '<div class="video-container" id="video-container"><video controls id="video" preload="metadata" poster="' + poster + '"><source src="https://cdn.shopify.com/s/files/1/0797/7215/files/find_your_fit.mp4?v=1608194262" type="video/mp4"></video><div class="play-button-wrapper"><div title="Play video" class="play-gif" id="circle-play-b"><!-- SVG Play Button --><svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M20 40C31.0457 40 40 31.0457 40 20C40 8.9543 31.0457 0 20 0C8.9543 0 0 8.9543 0 20C0 31.0457 8.9543 40 20 40ZM30.6627 20.1659C30.7804 20.0866 30.7804 19.9134 30.6627 19.8341L14.857 9.18781C14.7242 9.09833 14.5453 9.19352 14.5453 9.35369L14.5453 30.6463C14.5453 30.8064 14.7242 30.9016 14.857 30.8121L30.6627 20.1659Z" fill="white"/></svg><span>WATCH VIDEO</span></div></div></div>'
        $('.lo-product-guarantee').before(videoContent);

        var video = document.getElementById("video");
        var circlePlayButton = document.getElementById("circle-play-b");

        function togglePlay() {
            if (video.paused || video.ended) {
                video.play();
            } else {
                video.pause();
            }
        }

        circlePlayButton.addEventListener("click", togglePlay);
        video.addEventListener("playing", function() {
            circlePlayButton.style.opacity = 0;
        });
        video.addEventListener("pause", function() {
            circlePlayButton.style.opacity = 1;
        });




    },
    attachEvents: function() {
        $('#AddToCart').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "addToCart_click"
            }]);
        })

        $('.product-single__thumb-wrapper:last-child').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "heroPlayIcon_click"
            }]);
        })

        $('.play-gif').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "seperatePlayIcon_click"
            }]);
        })

        $('.fp_virtual-btn').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "virtualMirror_click"
            }]);
        })

        $('a.klaviyo-bis-trigger:contains("Out of Stock")').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "outOfStock_click"
            }]);
        })

        $('.fp_notsure').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "notSure_click"
            }]);
        })

        $('.fp_modal_container--first .fp_close').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "closeIcon_click"
            }]);
        })

        $('.download-eye-chart').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "downloadEyeChart_click"
            }]);
        })

        $('.determine-by-age').on('click', function() {
            window._fpEvent.push(["eventConversion", {
                value: "determineByAge_click"
            }]);
        })




    }

}.init();